import React from "react";
import styled from "styled-components";
function StickyFooter() {
  return (
    <Footer>
      For Data Removal | Complaints : Email us at helpindiacovid19.web@gmail.com
      <a href="#" target="#">
        Vaibhav
      </a>
      |
    </Footer>
  );
}

export default StickyFooter;

const Footer = styled.div`
  min-height: 60px;
  position: fixed;
  display:flex;
  align-items: center;
  justify-content: space-between;
  padding 0 20px;
  bottom: 0;
  left: 0;
  right: 0;
  z-index: 1;
`;
